const initialData=0;

const changeTheNumber=(state={initialData},action)=>{
  
    switch(action.type){
        case "INCREMENT" :return state=state.initialData+1; 
        case "DECREMENT" :return state=state.initialData-1; 
        default:return initialData;
        
    }


}

export default changeTheNumber;
